import React from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Container,
  Typography,
  Button,
  Grid,
  Paper,
  Box
} from '@mui/material';
import GitHubIcon from '@mui/icons-material/GitHub';
import CodeIcon from '@mui/icons-material/Code';
import BugReportIcon from '@mui/icons-material/BugReport';

const HomePage = () => {
  const navigate = useNavigate();

  return (
    <Container maxWidth="lg" sx={{ backgroundColor: '#0d1117', color: '#c9d1d9', py: 6, minHeight: '100vh' }}>
      <Box sx={{ textAlign: 'center' }}>
        <Typography variant="h2" component="h1" gutterBottom sx={{ fontWeight: 600, color: '#ffffff' }}>
          Test Case Generator
        </Typography>
        <Typography variant="h5" color="#8b949e" paragraph>
          Generate comprehensive test cases for your code using AI
        </Typography>
        <Button
          variant="contained"
          size="large"
          startIcon={<GitHubIcon />}
          onClick={() => navigate('/repository')}
          sx={{
            mt: 2,
            backgroundColor: '#238636',
            '&:hover': { backgroundColor: '#2ea043' },
            color: '#ffffff',
            fontWeight: 'bold'
          }}
        >
          Connect GitHub Repository
        </Button>
      </Box>

      <Grid container spacing={4} sx={{ mt: 6 }}>
        {[{
          icon: <GitHubIcon sx={{ fontSize: 60, color: '#58a6ff' }} />,
          title: 'GitHub Integration',
          text: 'Connect to your GitHub repositories, browse files, and select the code you want to test.'
        }, {
          icon: <CodeIcon sx={{ fontSize: 60, color: '#58a6ff' }} />,
          title: 'AI-Powered Analysis',
          text: 'Our AI analyzes your code and suggests comprehensive test cases tailored to your implementation.'
        }, {
          icon: <BugReportIcon sx={{ fontSize: 60, color: '#58a6ff' }} />,
          title: 'Test Code Generation',
          text: 'Generate ready-to-use test code for Jest, JUnit, Pytest, and more with a single click.'
        }].map((feature, i) => (
          <Grid item xs={12} md={4} key={i}>
            <Paper
              elevation={3}
              sx={{
                p: 3,
                height: '100%',
                display: 'flex',
                flexDirection: 'column',
                alignItems: 'center',
                textAlign: 'center',
                backgroundColor: '#161b22',
                color: '#c9d1d9'
              }}
            >
              {feature.icon}
              <Typography variant="h5" component="h2" gutterBottom sx={{ mt: 1, color: '#ffffff' }}>
                {feature.title}
              </Typography>
              <Typography variant="body1" color="#8b949e">
                {feature.text}
              </Typography>
            </Paper>
          </Grid>
        ))}
      </Grid>

      <Box sx={{ mt: 8, textAlign: 'center' }}>
        <Typography variant="h4" component="h2" gutterBottom sx={{ color: '#ffffff' }}>
          How It Works
        </Typography>

        <Grid container spacing={3} sx={{ mt: 2 }}>
          {[
            { step: '1. Connect Repository', text: 'Enter your GitHub repository details and select the files you want to test.' },
            { step: '2. Generate Test Summaries', text: 'Our AI analyzes your code and suggests test cases that cover various scenarios.' },
            { step: '3. Create Test Code', text: 'Select a test case summary to generate complete, ready-to-use test code.' }
          ].map((item, i) => (
            <Grid item xs={12} md={4} key={i}>
              <Box sx={{ p: 2 }}>
                <Typography variant="h6" gutterBottom sx={{ color: '#58a6ff' }}>
                  {item.step}
                </Typography>
                <Typography variant="body2" color="#8b949e">
                  {item.text}
                </Typography>
              </Box>
            </Grid>
          ))}
        </Grid>

        <Button
          variant="outlined"
          size="large"
          onClick={() => navigate('/repository')}
          sx={{
            mt: 4,
            borderColor: '#238636',
            color: '#ffffff',
            '&:hover': {
              backgroundColor: '#238636',
              color: '#ffffff',
              borderColor: '#2ea043'
            },
            fontWeight: 'bold'
          }}
        >
          Get Started
        </Button>
      </Box>
    </Container>
  );
};

export default HomePage;
